  `pay_source` int(11) DEFAULT '0' COMMENT '支付类型  1:支付宝 2：微信  3：银联  4：钱包   5:龙支付 6:ETC快捷支付',
  `upc_id` bigint(20) DEFAULT '0' COMMENT '用户优惠券表主键ID',
  `discount_type` int(11) DEFAULT '0' COMMENT '优惠券类型 0:金额券 1：折扣券',
  `discount_money` int(11) DEFAULT '0' COMMENT '抵扣优惠金额（单位 分）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='用户虚拟币行为记录表';

